$myFile = ($MyInvocation.MyCommand.Path)

Function Update {
$file1 = "$env:TMP\p2dVer.txt"
iwr https://raw.githubusercontent.com/I-Am-Jakoby/PowerShell-for-Hackers/main/Assets/Scripts/v.txt -o $file1
$text = [IO.File]::ReadAllText($file1)
[IO.File]::WriteAllText($file1, $text.TrimEnd())
$gitVer = Get-Content -Path $file1 -TotalCount 1

if($myVer -lt $gitVer){
$Update = MsgBox -m 'New version is available. update now?' -t "P2D Update" -b YesNo -i Question
if ($Update -eq "Yes"){


$updateFile = "$env:TMP\np2dupdate.ps1"
iwr https://raw.githubusercontent.com/I-Am-Jakoby/PowerShell-for-Hackers/main/Assets/Scripts/p2d-gui.ps1 -o $updateFile
$updateText = [IO.File]::ReadAllText($updateFile)
[IO.File]::WriteAllText($updateFile, $updateText.TrimEnd())
Copy-Item -Path $updateFile -Destination $myFile

}
elseif ($Update -eq "No"){[void]$Form.ShowDialog();exit}
}
elseif($myVer -ge $gitVer){echo "Fully Updated"}
Remove-Item $file1
}
